  function actionToButton(action) {
    switch (action) {
      case "UP":
        return 1 << 11
      case "DOWN":
        return 1 << 10
      case "LEFT":
        return 1 << 9
      case "RIGHT":
        return 1 << 8
      case "A":
        return 1 << 7
      case "B":
        return 1 << 15
      case "X":
        return 1 << 6
      case "Y":
        return 1 << 14
      case "L":
        return 1 << 5
      case "R":
        return 1 << 4
      case "START":
        return 1 << 12
      case "SELECT":
        return 1 << 13
      default:
        return 0
    }
  }

